import '../CSSContents/Login.css';
import { Link } from 'react-router-dom';
import { useState, useEffect } from "react";

function Login() {
    const [usernaem, setUsername] = useState("");
    const [password, setPassword] = useState("");

    const [signUpStatus, setSignUpStatu] = useState("");
    const [loginStatus, setLooginStatus] = useState("");
    return (
        <div classname='container'>
            <div className='signup-form'>
                <form>
                    <h4>Login</h4>
                    <label>Username</label>
                    <input
                        className='text-input'
                        type='username'
                        name='username'
                        placeholder='Enter your Username'
                        required
                        onChange={(e) => { setUsername(e.target.value) }}
                    >
                    </input>

                    <label>Password</label>
                    <input
                        className='text-input'
                        type='password'
                        name='password'
                        placeholder='Enter your username'
                        required
                        onChange={(e) => { setPassword(e.target.value) }}
                    >
                    </input>
                    <button className="fluid ui button blue"
                        onClick={Login}
                    >Sumbit</button>
                    <span className='form-input-login'> Already have an account? Login
                        <Link to='/SignUp'> Here </Link>
                    </span>
                </form>
            </div>
        </div>
    );
}





export default Login;
